import React, { Component, useState } from 'react';
import backgroundImage from "../../images/background.png";
import backgroundImage2 from "../../images/background 2.png";
import './timeline.css';
import Navbar from "../navbar";
import TimelineSpecific from './timeline_specific';

function WholeTimeline(props) {
    const initialTimeline = 0
    const imageOptions = [backgroundImage, backgroundImage2, backgroundImage, backgroundImage2]
    const [imageType, changeImage] = useState(imageOptions[initialTimeline]);

    return(

        <>
            <img src={imageType} className="backgroundImage" alt="background wing view"></img>
    
            <Navbar page={props.page} />
    
            <TimelineSpecific type="Programming" changeImage={changeImage} imageOptions={imageOptions} initialTimeline={initialTimeline} />
        </>

    )

}

class Timeline extends Component {

    constructor(props) {
        super(props);
        this.state = {
            imageType: "",
            imageOptions: [backgroundImage, backgroundImage2, backgroundImage, backgroundImage2]
        };
    }
    
    setInitialImage() {
        this.setState({
            imageType: this.state.imageOptions[0]
        });
    }

    render() {

        return(
    
            <div className="App">

                <WholeTimeline page={this.props.page}/>

            </div>
    
        )

    }

};

export default Timeline;
